import{_ as t}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as a,c as o,a8 as i,o as l}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"Takeoff Mode (Multicopter)","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_modes_mc/takeoff.md","filePath":"zh/flight_modes_mc/takeoff.md"}'),r={name:"zh/flight_modes_mc/takeoff.md"};function d(s,e,h,f,n,c){return l(),o("div",null,e[0]||(e[0]=[i('<h1 id="takeoff-mode-multicopter" tabindex="-1">Takeoff Mode (Multicopter) <a class="header-anchor" href="#takeoff-mode-multicopter" aria-label="Permalink to &quot;Takeoff Mode (Multicopter)&quot;">​</a></h1><img src="'+t+'" title="Position fix required (e.g. GPS)" width="30px"><p>The <em>Takeoff</em> flight mode causes the vehicle to take off to a specified height and wait for further input.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Mode is automatic - no user intervention is <em>required</em> to control the vehicle.</li><li>Mode requires at least a valid local position estimate (does not require a global position). <ul><li>Flying vehicles can&#39;t switch to this mode without valid local position.</li><li>Flying vehicles will failsafe if they lose the position estimate.</li><li>Disarmed vehicles can switch to mode without valid position estimate but can&#39;t arm.</li></ul></li><li>RC control switches can be used to change flight modes.</li><li>RC stick movement will <a href="#COM_RC_OVERRIDE">by default</a> change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> unless handling a critical battery failsafe.</li><li>The <a href="./../config/safety.html#failure-detector">Failure Detector</a> will automatically stop the engines if there is a problem on takeoff.</li></ul></div><h2 id="技术总结" tabindex="-1">技术总结 <a class="header-anchor" href="#技术总结" aria-label="Permalink to &quot;技术总结&quot;">​</a></h2><p>A multi rotor ascends vertically to the altitude defined in <a href="./../advanced_config/parameter_reference.html#MIS_TAKEOFF_ALT">MIS_TAKEOFF_ALT</a> and holds position.</p><p>RC stick movement will change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> (by <a href="#COM_RC_OVERRIDE">default</a>).</p><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><p>Takeoff is affected by the following parameters:</p><table tabindex="0"><thead><tr><th>参数</th><th>描述</th></tr></thead><tbody><tr><td><a id="MIS_TAKEOFF_ALT"></a><a href="./../advanced_config/parameter_reference.html#MIS_TAKEOFF_ALT">MIS_TAKEOFF_ALT</a></td><td>Target altitude during takeoff (default: 2.5m)</td></tr><tr><td><a id="MPC_TKO_SPEED"></a><a href="./../advanced_config/parameter_reference.html#MPC_TKO_SPEED">MPC_TKO_SPEED</a></td><td>Speed of ascent (default: 1.5m/s)</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Controls whether stick movement on a multicopter (or VTOL in MC mode) causes a mode change to <a href="./../flight_modes_mc/position.html">Position mode</a>. 可以分别为自动模式和 offboard 模式启用此功能，默认情况下在自动模式下启用此功能。</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>The amount of stick movement that causes a transition to <a href="./../flight_modes_mc/position.html">Position mode</a> (if <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> is enabled)</td></tr></tbody></table><h2 id="see-also" tabindex="-1">See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;See Also&quot;">​</a></h2><ul><li><a href="./../flight_modes_mc/throw_launch.html">Throw Launch (MC)</a></li><li><a href="./../flight_modes_fw/takeoff.html">Takeoff Mode (FW)</a></li></ul>',12)]))}const p=a(r,[["render",d]]);export{u as __pageData,p as default};
